    }

    render() {
        return <Header/>

    }
}
let mapStateToProps = (state) => ({
    userInfo: state.auth.userInfo,
    isAuth: state.auth.isAuth
});
let mapDispatchToProps = (dispatch) => ({
    me: () => {
        dispatch(me())
    }
})

export default connect(mapStateToProps, mapDispatchToProps)(HeaderContainer);
